import React from "react";

import {ReactComponent as EditIcon} from '../../assets/images/edit-icon.svg';
import {ReactComponent as BinIcon} from '../../assets/images/bin-icon.svg';

const IconButton = ({buttonType, onClick}) => {

  if (buttonType === "edit") {
    return (
    <button className="icon-button-edit" buttonText={<EditIcon className="icon-buttons-link-icon"/>}onClick={onClick}/> )
  } else if (buttonType === "delete") {
      return (
    <button className="icon-button-delete" buttonText={<BinIcon className="schedule-list__cards-row-buttons-link-icon"/>} onClick={onClick}/>
      )
  }
}

export default IconButton;
